import React from 'react';
import { navStyle } from '../navStyle';
//import { Button } from 'react-bootstrap/Button';
import Navbar, {NavbarBrand} from 'react-bootstrap/Navbar';


class Navigation extends React.Component {

  render() {

    let { color, backgroundColor } = navStyle;

    return (
      <div>
        <Navbar style={{backgroundColor}}>
          <NavbarBrand href="#home">
             Personal Capital
          </NavbarBrand>
          <Nav.Item>
            <Nav.Link href="/home">Financial Tools</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1">Wealth Management</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-2">About</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-2">Resources</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Button href="#">Login</Button>
          </Nav.Item>
          <Nav.Item>
            <Button href="#">Sign Up</Button>
          </Nav.Item>
        </Navbar>

      </div>
    )
  }
}

export default Navigation;
